import 'bootstrap/dist/css/bootstrap.min.css';
import { Helmet } from 'react-helmet';


const SignUp = () => {

    return (
        <div className="container-fluid">
            <Helmet>
                <title>Sign Up</title>
            </Helmet>
            
        </div>
    );
};

export default SignUp;
